import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom'; // Importa roteamento
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Image from 'react-bootstrap/Image'; 
import 'bootstrap/dist/css/bootstrap.min.css'; 
import lancheirinha from './assents/lancherinha.png'; 
import Garrafas from './Garrafas'; // Importa o componente Garrafas

function App() {
  return (
    <Router>
      <>
        <Navbar expand="lg" className="bg-body-tertiary">
          <Container>
            <Navbar.Brand as={Link} to="/">Lancheirinha da Nutri</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                <Nav.Link as={Link} to="/">Home</Nav.Link>
                <Nav.Link href="#link">Link</Nav.Link>
                <NavDropdown title="Produtos" id="basic-nav-dropdown">
                  <NavDropdown.Item as={Link} to="/garrafas">Garrafas TÃ©rmicas</NavDropdown.Item>
                  <NavDropdown.Item href="#action/3.2">
                    Vasilhas, copos e canudos
                  </NavDropdown.Item>
                  <NavDropdown.Item href="#action/3.3">Conjunto de Talheres</NavDropdown.Item>
                  <NavDropdown.Divider />
                  <NavDropdown.Item href="#action/3.4">
                    Brinquedos de cozinha infantil
                  </NavDropdown.Item>
                </NavDropdown>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>

        <FluidExample />

        {/* Definindo as rotas */}
        <Routes>
          <Route path="/garrafas" element={<Garrafas />} />
        </Routes>
      </>
    </Router>
  );
}

function FluidExample() {
  return <Image src={lancheirinha} fluid />; 
}

export default App;
